function memberService(ajaxService,sharedProperties,$localStorage,$q,spConfig,spValue){var allMember;this.getAllMembers=function(userType){var deferred=$q.defer();if(spValue.getAllMembers.length)deferred.resolve(spValue.getAllMembers);else{if(allMember)return allMember;ajaxService.getAjaxResponse({url:spConfig.talentAnalytics.memberService.getAll,data:$.param({type:userType})}).then(function(response){"true"===response.Success?(spValue.getAllMembers=response,deferred.resolve(response)):null!==response.error&&sharedProperties.ajaxError(response.error)})}return allMember=deferred.promise}}memberService.$inject=["ajaxService","sharedProperties","$localStorage","$q","spConfig","spValue"],angular.module("spApp").service("memberService",memberService);